@-moz-document domain("www.google.com"), domain("google.com"), domain("support.google.com"), domain("accounts.google.com") {

#maia-footer-global, #fbar, .footer-links-container {
    padding: 0 !important;
    width: 475px !important;
    height: 125px !important;
    background-repeat: no-repeat !important;
    background-image: url(data:image/jpeg;base64,) !important;
    }
    
.footer-links-container, .zn, .Ba {
    margin: 0 auto !important;
    width: 475px  !important;
    height: 125px !important;
    background-repeat: no-repeat !important;
    background-image: url(data:image/jpeg;base64,) !important;
    }
.google-footer-bar {
    width: 100% !important;
    height: 125px !important;
    background-repeat: no-repeat !important;
    background-image: url(data:image/jpeg;base64,) !important;
    }
#maia-footer-global ul {
    float: right !important;
    }

#fsl, .footer-links {
    margin-left: 500px !important;
    }
.footer-links, .fbar, .lang-chooser-wrap, .Vf, .Ba a {
    display: none !important;
    }
